import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className="App">
            <h1>MATEO VARGAS</h1>
            <Link to={'./projects'}>
                <button variant="raised">
                    Projects
                </button>
            </Link>
        </div>
    )
}

export default Home;
